<h1> New File <h1/>

{% for obj in objs %}
	{{ obj.pk }}
	<h1>{{ obj.long_url }}</h1><br>
	<a href="{{ obj.long_url }}">{{ obj.shortcode }}</a>
	<h2>{{ obj.created_date }}</h2>
	<button><a href="http://127.0.0.1:8000/edit/{{obj.pk}}">Edit</a></button>
	<button><a href="http://127.0.0.1:8000/delete/{{obj.pk}}">Delete</a></button>
{% endfor %}
